\ Orbit calculation things                                          sreyner

: under+  ( a b c -- a+c b )  rot + swap ;

2 cells constant /planet
create planets 3000 /planet * allot
variable #planets
: next-slot  ( -- addr )  planets #planets @ /planet * + ;

: lookup  { planet -- parent | 0 }
  next-slot planets do
    i @ planet =  if i cell+ @ unloop exit then
  /planet +loop 0 ;

: +orbit  ( parent planet -- )  next-slot ! next-slot cell+ ! 1 #planets +! ;
: (ao)    ( parent planet -- )  +orbit ; \ convenience

: (orbits)  ( acc planet -- u )  begin lookup dup while 1 under+ repeat drop ;
: orbits    ( planet -- u )      0 swap (orbits) ;

: total  ( -- )  0 next-slot planets do i @ orbits + /planet +loop ;

create YOU-path 1000 CELLS allot

variable #YOU-jumps
variable #SAN-jumps

: trace-YOU-path  ( -- )
  0 #YOU-jumps !
  [ 36 base ! ] YOU [ decimal ] lookup
  begin
    dup YOU-path #YOU-jumps @ cells + !
    1 #YOU-jumps +!
    lookup dup
  while
  repeat
  drop ;

: find-minimal-jumps ( -- )
  0 #SAN-jumps !
  [ 36 base ! ] SAN [ decimal ] lookup
  begin
    #you-jumps @ 0 do
      dup YOU-path I cells + @ = if I #san-jumps @ + unloop exit then
    loop
    1 #san-jumps +!
    lookup dup
  while
  repeat
  #san-jumps @ + ;


